    function doZoomedOut(eventObj, dataObj) {
        if (!isEvent) {
            isEvent = true;
            var ch1 = FusionCharts.items[eventObj.sender.id],
                start = ch1.getViewStartIndex(),
                end = ch1.getViewEndIndex();
            for (cht in FusionCharts.items) {
                cht = FusionCharts.items[cht];
                if (cht != ch1 && (cht.getViewStartIndex && cht.getViewStartIndex() != start ||
                        cht.getViewStartIndex && cht.getViewStartIndex() != end)) {
                    cht.zoomOut();
                }
            }
            isEvent = false;
            //  showProps(dataObj);
        }
    }

    function doZoomReset(eventObj, dataObj) {
        if (!isEvent) {
            isEvent = true;
            var ch1 = FusionCharts.items[eventObj.sender.id],
                start = ch1.getViewStartIndex(),
                end = ch1.getViewEndIndex();
            for (cht in FusionCharts.items) {
                cht = FusionCharts.items[cht];
                if (cht != ch1 && (cht.getViewStartIndex && cht.getViewStartIndex() != start ||
                        cht.getViewStartIndex && cht.getViewStartIndex() != end)) {
                    cht.resetChart();
                }
            }
            isEvent = false;
            // showProps(dataObj);
        }
    }

    function doScrollEnd(eventObj, dataObj) {
        if (!isEvent) {
            isEvent = true;
            var ch1 = FusionCharts.items[eventObj.sender.id],
                start = ch1.getViewStartIndex(),
                end = ch1.getViewEndIndex();
            for (cht in FusionCharts.items) {
                cht = FusionCharts.items[cht];
                if (cht != ch1 && (cht.getViewStartIndex() != start ||
                        cht.getViewStartIndex() != end)) {
                    cht.zoomOut();
                    cht.zoomTo(start, end);
                }
            }
            isEvent = false;
            // showProps(dataObj);
        }
    }

    // array to store scroll position and time on every scrolling event listen
    var scrollPosArr = [];

    function scrollSync(eventObj, dataObj) {
        return (function() {
            if (!isEvent) {
                scrollPosArr.push({
                    time: performance.now(),
                    pos: dataObj.scrollPosition
                });
                isEvent = true;
                var ch1 = FusionCharts.items[eventObj.sender.id],
                    len = scrollPosArr.length;
                for (cht in FusionCharts.items) {
                    cht = FusionCharts.items[cht];
                    //call scrollTo on every 16 mili Sec. for minimise the performance hit
                    // if (cht != ch1 && (scrollPosArr[len - 1].time - scrollPosArr[0].time) >= 16) {
                    if (cht != ch1) {
                        cht.scrollTo(scrollPosArr[len - 1].pos);
                        // scrollPosArr.length = 0;
                    }

                }
                isEvent = false;
            }
        })(dataObj);
    }

    function doZoomedIn(eventObj, dataObj) {
        if (!isEvent) {
            isEvent = true;
            var ch1 = FusionCharts.items[eventObj.sender.id],
                start = ch1.getViewStartIndex(),
                end = ch1.getViewEndIndex();
            for (cht in FusionCharts.items) {
                cht = FusionCharts.items[cht];
                if (cht != ch1 && (cht.getViewStartIndex && cht.getViewStartIndex() != start ||
                        cht.getViewStartIndex && cht.getViewStartIndex() != end)) {
                    cht.zoomTo(start, end);
                }
            }
            isEvent = false;
            // showProps(dataObj);
        }
    }

    function showProps(dataObj) {
        var header = document.getElementById('header');

        var tempDiv = document.createElement('div');
        var attrsTable2 = document.getElementById('attrs-table2');
        for (var prop in dataObj) {
            titleDiv = document.createElement('div');
            titleDiv.className = 'title';
            titleDiv.innerHTML = prop;

            valueDiv = document.createElement('div');
            valueDiv.className = 'value';
            valueDiv.innerHTML = dataObj[prop];

            tempDiv.appendChild(titleDiv);
            tempDiv.appendChild(valueDiv);
        }
        attrsTable2.innerHTML = '';
        attrsTable2.appendChild(tempDiv);
    }
